import axios from 'axios';
import React, { useState, useEffect } from 'react';
import { LineChart, Line } from 'recharts';

function ReservoirData(props) {

    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const url = '/dynamicapp/req/JSONDataServlet?Stations=ORO&SensorNums=15&dur_code=D&Start=2023-07-24&End=2023-08-24';
        axios.get(url)
            .then(response => {
                setData(response.data);
                console.log(data);
                setLoading(false);
            })
            .catch(error => {
                console.log(error)
                setError(error);
                setLoading(false);
            })
    }, [])

    if (loading) {
        return <div>
            <h1>
                Loading...
            </h1>
        </div>;
    }

    if (error) {
        return <p>Error: {error.message}</p>;
    }

    return (
        <div className="ReservoirCard">
            <h3>
                {props.name}

                <div>
                    <ul>
                        {data.map(item => (
                            <li >{item.value}</li>
                        ))}
                    </ul>
                </div>

            </h3>
        </div>
    )
}

export default ReservoirData;
